import axios from "axios"

class UserService {


    async loginUser(json) {

        const axiosConfig = {
            headers: {
                'Content-Type': 'application/json;charset=UTF-8',
                "Access-Control-Allow-Origin": "*",
            }
        };

        const response = axios.post("http://localhost:8102/users/validate", json, axiosConfig);

            console.log("DATA: ", response.data);
            return response.data;
    }

    registerUser(json) {

        const axiosConfig = {
            headers: {
                'Content-Type': 'application/json;charset=UTF-8',
                "Access-Control-Allow-Origin": "*",
            }
        };

        return axios.post("http://localhost:8102/users/save", json, axiosConfig)
            .then((res) => {
                console.log("RESPONSE RECEIVED: ", res);
            })
            .catch((err) => {
                console.log("AXIOS ERROR: ", err);
                alert("There was an error in processing your request. Please try again later.");
            })
    }

}

export default new UserService();
